INSERT INTO CREDITO VALUES(SEQ_CREDITO.NEXTVAL,'Crédito por Pago de Arancel','Crédito para el pago parcial o completo de una carrera destinado a los trabajadores (dependientes o independientes) que acrediten renta mínima de $900.000 mensual. El tope del crédito es de $2.000.000',0.80,48);
